import { useState } from 'react';
import TaskItem from './TaskItem';

import './TaskList.css';

const TaskList = (props) => {
    const a = [{tasktitle:"Pramod", taskDaysLeft:"7"}];
    a.map(e => console.log(e.tasktitle + ' ' + e.taskDaysLeft))

    return (
        <div className='task-list-container'>
            <TaskItem title={a[0].tasktitle} daysLeft={a[0].taskDaysLeft} />
        </div>
    ); 
}

export default TaskList;
